import React from "react";
import CharacterList from "./components/CharacterList/CharacterList";

function App() {
  return (
    <div>
      <header>
        <h1>Rick and Morty Characters</h1>
      </header>
      <main>
        <CharacterList />
      </main>
      <footer>
        <p>Desarrollado por [Tu Nombre]</p>
      </footer>
    </div>
  );
}

export default App;
